			<div className="inner">

			<a href="/" className="logo">
			<span className="symbol"><img src="../../images/common/me2021.jpg" alt="" /></span><span class="title">Sebastian S. Rodriguez</span>
			</a>


			</div>
			</header>
			</>
		)
	}
}
